INSERT INTO `SITE_OPTIONS` (`SITE_URL`, `MISSION`, `VISION`, `OBJECTIVE`) VALUES
('', '1. To improve a smart energy meter with remote disconnection feature to continue to the local electric utility company.<br>\n2. To be able to monitor the information of monthly consumption of electricity of each household to avoid disconnection.\n3. To help the personnel of the utility company do not have personally visity the household for meter reading.', '1. To provide local utilities with a convenient tool for them to track and monitor monthly electricity consumption of every household in Marawi City.\n2. To lessen the work and cost of the personnel of the local electric utility company to personally visit each residential household in Marawi City...', 'The main objectives of the project are the following:\n1. To improve the accuracy of the developed smart energy meter....\na. Measure and collect the energy consumption of every household real-time to the utility.\nb. Transmit data/readings to the server module for the consumers and electric utility company\'s reference.\nc. With remote disconnection features....\n\n2.To implement a prototype of the design.\n3. To test and evaluate the design.');
